import {ContainerRanking, RenderData} from '../style/style'
import axios from 'axios'
import { useEffect, useState } from 'react'

function Ranking () {
    const [players, setPlayers ] = useState([])
    async function RankingPlayers () {
        const data = await axios.get('http://localhost:3333/busca')
        setPlayers(data.data)
    }
    useEffect(() => {
        
       RankingPlayers()
    },[])
    return (
        <ContainerRanking>
            <h2>Nome</h2> <h2>Rating</h2>
            {
                players.map((element,i) => {
                    return (
                        <RenderData>
                            {element.name, element.rating}
                        </RenderData>
                    )
                })
            }
        </ContainerRanking>
    )
}


export default Ranking
